var iconData = 'data:image/png;base64,';
var iconShadowData = 'data:image/png;base64,';    

function myIcon() {
       return L.icon({
            iconUrl: iconData,
            iconRetinaUrl: iconData,
            iconSize: [56/2, 86/2],
            iconAnchor: [56/4, 86/2],
            popupAnchor: [0, -34],
            shadowUrl: iconShadowData,
            shadowRetinaUrl: iconShadowData,
            shadowSize: [64/2, 33/2],
            shadowAnchor: [15, 13]
        });
 }